import React from 'react';

function WorkerList({ workers }) {
  return (
    <div className="grid">
      {workers.map((worker, index) => (
        <span key={index} className="worker-name">
          {worker.name}
        </span>
      ))}
    </div>
  );
}

export default WorkerList;
